<style media="screen">
html,body{margin:0;padding:0;height:100%;}
#wrapper{min-height:100%;position:relative;}
#header{padding:10px;}
#content{padding:10px;padding-bottom:60px;}
#footer{position:absolute;bottom:0;width:100%;height:60px;}
html{font-family:sans-serif;-ms-text-size-adjust:100%;-webkit-text-size-adjust:100%;}
body{margin:0;}
footer{display:block;}
a{background-color:transparent;}
a:active,a:hover{outline:0;}
@media print{
*,*:before,*:after{background:transparent!important;color:#000!important;-webkit-box-shadow:none!important;box-shadow:none!important;text-shadow:none!important;}
a,a:visited{text-decoration:underline;}
a[href]:after{content:" (" attr(href) ")";}
p{orphans:3;widows:3;}
.navbar{display:none;}
}
*{-webkit-box-sizing:border-box;-moz-box-sizing:border-box;box-sizing:border-box;}
*:before,*:after{-webkit-box-sizing:border-box;-moz-box-sizing:border-box;box-sizing:border-box;}
html{font-size:10px;-webkit-tap-highlight-color:rgba(0,0,0,0);}
body{font-family:"Roboto","Helvetica Neue",Helvetica,Arial,sans-serif;font-size:13px;line-height:1.846;color:#666666;background-color:#ffffff;}
a{color:#2196f3;text-decoration:none;}
a:hover,a:focus{color:#0a6ebd;text-decoration:underline;}
a:focus{outline:5px auto -webkit-focus-ring-color;outline-offset:-2px;}
p{margin:0 0 11.5px;}
.container{margin-right:auto;margin-left:auto;padding-left:15px;padding-right:15px;}
@media (min-width:768px){
.container{width:750px;}
}
@media (min-width:992px){
.container{width:970px;}
}
@media (min-width:1200px){
.container{width:1170px;}
}
.btn{display:inline-block;margin-bottom:0;font-weight:normal;text-align:center;vertical-align:middle;-ms-touch-action:manipulation;touch-action:manipulation;cursor:pointer;background-image:none;border:1px solid transparent;white-space:nowrap;padding:6px 16px;font-size:13px;line-height:1.846;border-radius:3px;-webkit-user-select:none;-moz-user-select:none;-ms-user-select:none;user-select:none;}
.btn:focus,.btn:active:focus{outline:5px auto -webkit-focus-ring-color;outline-offset:-2px;}
.btn:hover,.btn:focus{color:#444444;text-decoration:none;}
.btn:active{outline:0;background-image:none;-webkit-box-shadow:inset 0 3px 5px rgba(0,0,0,0.125);box-shadow:inset 0 3px 5px rgba(0,0,0,0.125);}
.btn-primary{color:#ffffff;background-color:#2196f3;border-color:transparent;}
.btn-primary:focus{color:#ffffff;background-color:#0c7cd5;border-color:rgba(0,0,0,0);}
.btn-primary:hover{color:#ffffff;background-color:#0c7cd5;border-color:rgba(0,0,0,0);}
.btn-primary:active{color:#ffffff;background-color:#0c7cd5;border-color:rgba(0,0,0,0);}
.btn-primary:active:hover,.btn-primary:active:focus{color:#ffffff;background-color:#0a68b4;border-color:rgba(0,0,0,0);}
.btn-primary:active{background-image:none;}
.navbar{position:relative;min-height:64px;margin-bottom:23px;border:1px solid transparent;}
@media (min-width:768px){
.navbar{border-radius:3px;}
}
.navbar-static-top{z-index:1000;border-width:0 0 1px;}
@media (min-width:768px){
.navbar-static-top{border-radius:0;}
}
.navbar-brand{float:left;padding:20.5px 15px;font-size:17px;line-height:23px;height:64px;}
.navbar-brand:hover,.navbar-brand:focus{text-decoration:none;}
@media (min-width:768px){
.navbar>.container .navbar-brand{margin-left:-15px;}
}
.navbar-inverse{background-color:#2196f3;border-color:transparent;}
.navbar-inverse .navbar-brand{color:#b2dbfb;}
.navbar-inverse .navbar-brand:hover,.navbar-inverse .navbar-brand:focus{color:#ffffff;background-color:transparent;}
.container:before,.container:after,.navbar:before,.navbar:after{content:" ";display:table;}
.container:after,.navbar:after{clear:both;}
.navbar{border:none;-webkit-box-shadow:0 1px 2px rgba(0,0,0,0.3);box-shadow:0 1px 2px rgba(0,0,0,0.3);}
.navbar-brand{font-size:24px;}
.btn-primary{position:relative;}
.btn-primary:focus{background-color:#2196f3;}
.btn-primary:hover,.btn-primary:active:hover{background-color:#0d87e9;}
.btn-primary:active{-webkit-box-shadow:2px 2px 4px rgba(0,0,0,0.4);box-shadow:2px 2px 4px rgba(0,0,0,0.4);}
.btn-primary:after{content:"";display:block;position:absolute;width:100%;height:100%;top:0;left:0;background-image:-webkit-radial-gradient(circle, #fff 10%, transparent 10.01%);background-image:-o-radial-gradient(circle, #fff 10%, transparent 10.01%);background-image:radial-gradient(circle, #fff 10%, transparent 10.01%);background-repeat:no-repeat;-webkit-background-size:1000% 1000%;background-size:1000% 1000%;background-position:50%;opacity:0;pointer-events:none;-webkit-transition:background .5s, opacity 1s;-o-transition:background .5s, opacity 1s;transition:background .5s, opacity 1s;}
.btn-primary:active:after{-webkit-background-size:0% 0%;background-size:0% 0%;opacity:.2;-webkit-transition:0s;-o-transition:0s;transition:0s;}
.btn{text-transform:uppercase;border:none;-webkit-box-shadow:1px 1px 4px rgba(0,0,0,0.4);box-shadow:1px 1px 4px rgba(0,0,0,0.4);-webkit-transition:all 0.4s;-o-transition:all 0.4s;transition:all 0.4s;}
body{-webkit-font-smoothing:antialiased;letter-spacing:.1px;}
p{margin:0 0 1em;}
a{-webkit-transition:all 0.2s;-o-transition:all 0.2s;transition:all 0.2s;}
